import logo from './logo.svg';
import './App.css';
import React, { Component } from 'react';
import {
    BrowserRouter as Router,
    Routes,
    Route,
    useRoutes,
     Link } from "react-router-dom";
import IntroPage from './components/IntroPage/IntroPage'
import QuestionsPage from "./components/QuestionsPage/QuestionsPage";
import DatePage from "./components/DatePage/DatePage";
import CompletionPage from "./components/CompletionPage/CompletionPage";

const routes = {
  "/": () => <IntroPage /> ,
  "/questions": () =>  <QuestionsPage /> ,
  "/date": () => <DatePage /> ,
  "/completion": () => <CompletionPage /> 
}

function App() {
  return (
      <Router>
        <div>
          <Link to={'/'} >Home</Link> 
          <br />
          <Link to={'/questions'} >Questions</Link> 
          <br />
          <Link to={'/date'}>Date</Link>
          <br />
          <Link to={'/completion'}>Completion</Link>
          <Routes>
            <Route exact path='/' element={<IntroPage/>} />
            <Route path='/questions' element={<QuestionsPage/>} />
            <Route path='/date' element={<DatePage/>} />
            <Route path='/completion' element={<DatePage/>} />
            </Routes>
        </div>
      </Router>
    );
  }

export default App;
